import React from 'react';
import { Container, Typography, Box, Grid, Paper } from '@mui/material';
import { styled } from '@mui/material/styles';

// Styled component for the map container
const MapContainer = styled(Paper)(({ theme }) => ({
  padding: theme.spacing(2),
  height: '400px',
  width: '100%',
  boxSizing: 'border-box',
}));

const ContactPage = () => {
  return (
    <Container className="container">
      <Box mt={4}>
        <Typography variant="h2" align="center">Contact Us</Typography>

        <Grid container spacing={4} mt={4} alignItems="flex-start">
          {/* Left Side - Contact Info */}
          <Grid item xs={12} md={6}>
            <Box>
              <Typography variant="h5" align="center">Email & Phone</Typography>
              <img 
                src="/images/spa.jpg" 
                alt="Spa" 
                style={{ width: '100%', height: 'auto', marginTop: '20px' }} 
              />
              <Typography variant="body1" mt={2} align="center">
                Email: contact@nailtiquecloster.com
                <br />
                Phone: (555) 123-4567
              </Typography>
            </Box>
          </Grid>

          {/* Right Side - Google Maps */}
          <Grid item xs={12} md={6}>
            <Box>
              <Typography variant="h5" align="center">VISIT NAIL TIQUE</Typography>

              <Typography variant="body1" align="center" mt={2}>
                160 Spear St, San Francisco, CA 94105
              </Typography>
              <MapContainer elevation={3}>
                <iframe
                  title="Google Maps"
                  src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3153.7417892261987!2d-122.41941868468182!3d37.77492927975987!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x808581d4d6c4e5bb%3A0x21f4f97e80d43009!2s160%20Spear%20St%2C%20San%20Francisco%2C%20CA%2094133!5e0!3m2!1sen!2sus!4v1639036203440!5m2!1sen!2sus"
                  width="100%"
                  height="100%"
                  style={{ border: 0 }}
                  allowFullScreen=""
                  loading="lazy"
                />
              </MapContainer>
            </Box>
          </Grid>
        </Grid>

        {/* Spacer */}
        <Box mt={8} mb={4} /> {/* Adjust mt and mb values to control the space */}
      </Box>
    </Container>
  );
};

export default ContactPage;
